import React, { useContext } from 'react';
import AppContext from '../../context/AppContext';

const DashboardPage = () => {

  const { app, auth, appErr } = useContext(AppContext);

  return !!auth.currentUser && auth.isLoggedIn ? (
    <div>Logged In</div>
  ) : (
    <div>Logged out</div>
  )
};

export default DashboardPage;
